import { Route, Router, Switch } from 'react-router-dom';
import '../..App.css';
import HeroSection from '../HeroSection'
import Navbar from '../navbar';

function Home() {
    return (
        <>
            <Router>
                <Navbar>
                    <Switch>
                        <Route path='/' exact component={Home}></Route>
                    </Switch>
                </Navbar>
            </Router>
        </>
    )
}
